


def valid_palindrome(s: str) -> bool:
    '''
    Given a string s, return true if the s can be palindrome after deleting at most one character from it.
    '''
    
    left = 0
    right = len(s)-1
    def something(s, left, right):
        while left < right:
            if s[left] != s[right]:
                return False
            left += 1
            right -= 1
        return True
    
    while left < right:

        if s[left] != s[right]:
            return something(s, left + 1, right) or something(s, left, right -1)
        left += 1
        right -= 1
    return True


def test_one():
    assert valid_palindrome('abc') == False

def test_two():
    assert valid_palindrome('aba') == True

def test_three():
    assert valid_palindrome('abca') == True

def test_328():
    assert valid_palindrome('cbbcc') == True

def test_375_fucking_timeout():
    assert valid_palindrome("") == True